import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <body>
        <audio controls>
            <source src="yogirl.mp3" type="audio/mpeg" />
            Your browser does not support the audio element.
        </audio>
      </body>
    </div>
  );
}

export default App;
